/**
 * @fileoverview Routines to state whether a given version needs updating,
 * and other version-based attributes.
 */
'use strict';

/**
 * Return whether gnubby is a pilot Feitian device with out of date USB
 * firmware.
 * @param {GnubbyEnumerationFilter} enumeratedBy The enumeration filter that
 *     was used to open the gnubby.
 * @return {boolean} whether it's an early pilot Feitian device.
 */
function gnubby_isFeitianDeviceWithOutdatedUsbFirmware(enumeratedBy) {
  return enumeratedBy.vendorId == 2414 && enumeratedBy.productId == 2138;
}

/**
 * Return whether gnubby applet needs an update.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function gnubby_needsUpdate(opt_current) {
  return !!opt_current && opt_current < gnubby_currentVersionString;
}

/**
 * Return whether gnubby is likely a pilot one.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether gnubby is likely pilot one.
 */
function gnubby_isPilotVersion(opt_current) {
  return !!opt_current && opt_current == gnubby_pilotVersionString;
}

/**
 * Return whether ssh applet needs an update.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function ssh_needsUpdate(opt_current) {
  var result = !!opt_current && opt_current < ssh_currentVersionString;
  return result;
}

/**
 * Return whether ssh applet supports PIN change.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether PIN change is supported.
 */
function ssh_supportsPINChange(opt_current) {
  var old = !opt_current || opt_current < '0.1.0';
  return !old;
}

/**
 * Return the platform identifier contained in the sysinfo response, as
 * a string.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {string} The platform identifier, as a string
 */
function sysInfoToPlatformId(sysInfo) {
  // Platform ID is a string in the first 8 bytes of the sysinfo. Trailing nuls
  // are stripped.
  var s = sysInfo.subarray(0, 8);
  var end = s.indexOf(0);
  if (end != -1) {
    s = s.subarray(0, end);
  }
  return UTIL_BytesToString(s);
}

/**
 * Return the firmware version contained in the sysinfo response, as a
 * byte array.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {Uint8Array} The firmware version, as a byte array.
 */
function sysInfoToFirmwareVersionBytes(sysInfo) {
  // Sample sysinfo response data:
  //'476E75626279310000070400040108A0000005271002010000000000000000'
  // Firmware version is at byte offsets 8 - 10, i.e. 0.7.4 in the above
  // example.
  return sysInfo.subarray(8, 8 + 3);
}

/**
 * Return the firmware version contained in the sysinfo response, as a
 * version string.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {string} The firmware version, as a string.
 */
function sysInfoToFirmwareVersionString(sysInfo) {
  var fwVersion = sysInfoToFirmwareVersionBytes(sysInfo);
  return '' + fwVersion[0] + '.' + fwVersion[1] + '.' + fwVersion[2];
}

/**
 * Return the applet version contained in the sysinfo response, as a
 * byte array.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {Uint8Array} The applet version, as a byte array.
 */
function sysInfoToAppletVersionBytes(sysInfo) {
  // Sample sysinfo response data:
  //'476E75626279310000070400040108A0000005271002010000000000000000'
  // Applet version is at byte offsets 11 - 13, i.e. 0.4.1 in the above
  // example.
  return sysInfo.subarray(11, 11 + 3);
}

/**
 * Return the U2F applet version contained in the sysinfo response, as a
 * version string.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {string} The U2F applet version, as a string.
 */
function sysInfoToU2fAppletVersionString(sysInfo) {
  var appletVersion = sysInfoToAppletVersionBytes(sysInfo);
  return '' + appletVersion[0] + '.' + appletVersion[1] + '.'
      + appletVersion[2];
}

/**
 * Compares two version numbers (dot separated integers). Components
 * are compared lexicographically.
 * @param {string=} opt_a Left-hand side version number
 * @param {string=} opt_b Right-hand side version number
 * @return {number} -1 if a < b, 0 if a == b, 1 if a > b
 */
function cmp_version(opt_a, opt_b) {
  // Shortcuts for common cases
  if (opt_a === opt_b) return 0;
  if (opt_a !== undefined && opt_b === undefined) return 1;
  if (opt_a === undefined && opt_b !== undefined) return -1;

  var a = /** @type {string} */ (opt_a);
  var b = /** @type {string} */ (opt_b);
  var va = a.split('.').map(function(x) {return parseInt(x, 10);});
  var vb = b.split('.').map(function(x) {return parseInt(x, 10);});
  for (var i = 0; i < Math.min(va.length, vb.length); i++) {
    if (va[i] == vb[i]) continue;
    return va[i] < vb[i] ? -1 : 1;
  }
  if (va.length < vb.length) return -1;
  if (va.length > vb.length) return 1;
  return 0;
}

/**
 * Checks if a platformId is a known one.
 * @param {string} platformId Platform ID to check
 * @return {boolean} true if the platform ID is recognized.
 */
function isValidPlatformId(platformId) {
  return firmwares.hasOwnProperty(platformId);
}

/**
 * Returns a list of firmwares for a platform.
 * @param {string} platformId Platform ID
 * @return {Object} Firmware information
 */
function getFirmwaresForPlatform(platformId) {
  return firmwares[platformId] || [];
}

/**
 * Compares two firmware data objects, based on their version.
 * @param {Object} a Left-hand side firmware object.
 * @param {Object} b Right-hand side firmware object.
 * @return {number} -1 if a.version < b.version, 0 if a.version == b.version,
 *     1 if a.version > b.version
 */
function cmp_firmwareVersion(a, b) {
  return cmp_version(a.version, b.version);
}

/**
 * Return the latest firmware marked as auto-update, given a current version.
 * @param {string} platformId Platform identifier.
 * @param {string=} opt_current Current installed version.
 * @return {string|undefined} The latest version, or undefined if none.
 */
function firmware_getLatestAutoUpdate(platformId, opt_current) {
  if (!isValidPlatformId(platformId)) return undefined;
  var candidates = getFirmwaresForPlatform(platformId).filter(function (fw) {
    return fw.autoUpdate(opt_current);
  });
  candidates.sort(cmp_firmwareVersion);
  if (candidates.length > 0) {
    return candidates.pop().version;
  }
  return undefined;
}

/**
 * Return whether firmware needs an update.
 * @param {string} platformId Platform identifier.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function firmware_needsUpdate(platformId, opt_current) {
  if (!opt_current) return true;
  var latest = firmware_getLatestAutoUpdate(platformId, opt_current);
  if (!latest) return false;
  return 0 > cmp_version(opt_current, latest);
}

/**
 * Return HTML OPTION string for firmware version.
 * @param {string} platformId Current platformId string
 * @param {string} version Current version string
 * @param {string} displayName Display name for the option.
 * @param {boolean=} opt_selected If the option should be selected
 * @return {string} annotated HTML OPTION.
 */
function firmware_asOptionString(platformId, version, displayName, opt_selected) {
  var s = '<option value="';
  s += platformId + '-' + version;
  s += '"';
  if (opt_selected) s+= ' selected';
  s += '>';
  s += displayName;
  s += '</option>';
  return s;
}

/**
 * Return string of HTML OPTION choices for available firmwares.
 * @param {string} platformId Platform identifier
 * @param {string=} opt_current Current version.
 * @return {string} HTML.
 */
function firmware_options(platformId, opt_current) {
  function formatCurrent() {
    var current = /** @type {string} */ (opt_current);
    return firmware_asOptionString(platformId, current, current, true);
  }

  var s = "";
  var vs = getFirmwaresForPlatform(platformId);
  var currentShown = false;
  for (var i = 0; i < vs.length; i++) {
    if (0 == cmp_version(opt_current, vs[i].version)) {
      s += firmware_asOptionString(platformId, vs[i].version, vs[i].displayName, true);
      currentShown = true;
      continue;
    }
    if (!currentShown && opt_current &&
        0 > cmp_version(opt_current, vs[i].version)) {
      s += formatCurrent();
      currentShown = true;
    }
    s += firmware_asOptionString(platformId, vs[i].version, vs[i].displayName, false);
  }
  if (!currentShown && opt_current) {
    s += formatCurrent();
  }
  return s;
}

/**
 * Return desired firmware image.
 * @param {string} platformId of firmware.
 * @param {string=} opt_version of firmware.
 * @return {?string} hex-encoded firmware code.
 */
function firmware_getImage(platformId, opt_version) {
  if (!opt_version) return null;
  if (isValidPlatformId(platformId)) {
    var fws = getFirmwaresForPlatform(platformId);
    for (var i = 0; i < fws.length; i++) {
      if (fws[i].version == opt_version) {
        return fws[i].image;
      }
    }
  }
  return null;
}

/**
 * Return the firmware update function name for the given platform
 * @param {string} platformId The platform id
 * @return {?string} The update function name
 */
function firmware_getUpdateFunction(platformId) {
    if (!isValidPlatformId(platformId)) return null;
    switch (platformId.substring(0, 3)) {
      case 'Gnu': // Gnubby1, Gnubby2, GnuBLE
        return 'firmwareUpdate';
      case 'pro':  // proto2_A, proto2_B
      case 'hg_':  // All other Haven gnubbies
        return 'firmwareUpdateEx';
    }
    return null;
}

/**
 * Return firmware update function for the gnubby.
 * @param {string} platformId of firmware.
 * @param {Gnubby} gnubby The gnubby.
 * @return {?function(Uint8Array, Function=)} Firmware update function.
 */
function firmware_bindUpdateFunction(platformId, gnubby) {
  var fns = {
    'firmwareUpdate': gnubby.firmwareUpdate,
    'firmwareUpdateEx': gnubby.firmwareUpdateEx,
  };
  var function_name = firmware_getUpdateFunction(platformId);
  if (fns.hasOwnProperty(function_name)) {
    return fns[function_name].bind(gnubby);
  }
  return null;
}

/**
 * Return whether fob supports applet deletions.
 * @param {string} platformId of firmware.
 * @return {boolean}
 */
function firmware_hasDelete(platformId) {
  switch (platformId.substring(0, 3)) {
    case 'pro':
    case 'hg_':
      return false;
  }
  return true;
}

var gnubby_pilotVersionString = '0.4.1';

var gnubby_currentVersionString = '1.0.2';
var ssh_currentVersionString = '0.1.3';

// This variable stores firmwares per platform.
// Each platform stores a list of objects with the following properties:
//  version: string - The version idenfier (d.d.d)
//  displayName: string - How the firmware is shown in the options dialog.
//  autoUpdate: function(currentVersion): boolean 
//        A function that tests if this version is a candidate for automatic
//        updates, given the version of the currently installed firmware.
//  image: string - The firmware image as a hex string
//
//  Automatic updates choose the highest version for which autoUpdate returns
//  true.
var firmwares = {
  'Gnubby1': [
    {
      version: '0.3.4',
      displayName: '0.3.4 (USB)',
      autoUpdate: function (current) { return true; },
      image: ''
    },
    {
      version: '0.9.7',
      displayName: '0.9.7 (HID)',
      autoUpdate: function (current) { return 0 >= cmp_version('0.6.0', current); },
      image: ''
    }
  ],
  'Gnubby2': [
    {
      version: '0.3.5',
      displayName: '0.3.5 (USB)',
      autoUpdate: function (current) { return true; },
      image: ''
    },
    {
      version: '2.0.2',
      displayName: '2.0.2 (HID)',
      autoUpdate: function (current) { return true; },
      image: ''
    }
  ],
  'GnubBLE': [
    {
      version: '0.3.1',
      displayName: '0.3.1 (USB)',
      autoUpdate: function(current) { return false; },
      image: ''
    },
    {
      version: '0.3.2',
      displayName: '0.3.2 (USB)',
      autoUpdate: function(current) { return false; },
      image: ''
    },
  ],
  'hg_0004A': [
    {
      version: '3.0.15',
      displayName: '3.0.15',
      autoUpdate: function(current) { return true; },
      image: ''
    }
  ],
  'hg_0004B': [
    {
      version: '3.0.15',
      displayName: '3.0.15',
      autoUpdate: function(current) { return true; },
      image: ''
    }
  ],
  'FT__FIDO': [
  ],
};

